import React from 'react';
import './Navbar.css';

function Navbar() {
    return (
        <BrowserRouter>
            <div className="App">
                <Navbar />
                <Routes>
                    {/* <Route exact path='/resume' element={<Resume />} /> */}
                    <Route exact path='/Contact' element={<Contacts />} />
                    <Route exact path='/Projects' element={<Projects />} />
                    <Route exact path='/' element={<Home />} />
                </Routes>

            </div>
        </BrowserRouter>
    );
}

export default Navbar;
